import Navbar from "../components/Layout";

function Menu() {
  return (
    <div className="Menu">
      <Navbar/>
        <h1 className="text-6xl text-center text-6xl hover:transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300">Menu</h1>
        <br/><hr/><br/>
    </div>
    );
}

export default Menu;
